import React, { Component } from 'react'

class Retweeter extends Component {
	constructor (props) {
		super (props)
		this.state = {
			stars: [{...this.props.data}]
		}
	}

	handleClick = () => {
		var newStar = 
		[{
			name: 'Sebi "The Viking"',
			review: 'Alex suffers from inner genital syndrome',
			message: 'Placeholder',
			rating: Math.round(Math.random()*100)
		}]

		var currentStar = 
		{
			name: this.props.name,
			review: this.props.review,
			message: this.props.message,
			rating: this.props.rating,
		}
		this.setState({
      stars: [{...newStar, ...this.state.stars}]
		})
		console.log(this.props.data)
	}

  render () {
    return (
      <div>
        <button onClick={this.handleClick}> Retweet </button>
      </div>
    )
  }
}

export default Retweeter
